import React from 'react';

const pallet = (props) => {

    let colors = props.colors.map(color => {
        return <div 
                    className="pallet__color"
                    //style={{backgroundColor=color}}
                >{color}l</div>
    });

    return(
        <div>
            <h3>{props.title}</h3>
            {colors}
        </div>
    );
};

export default pallet;
